import React from 'react';


import HomePage from './component/navbar/homepage.component'
import Navbar from './component/navbar/navbar.component';
import './App.css';
import { Switch, Route ,BrowserRouter} from 'react-router-dom';
import Authority from './Authorities/authorities.component';
import RFID from './RFID.component/rfid.component';
import Customised from './customised.component/customised.component';
import ABOUT from './about.component/about.component';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Navbar /> 
        <Switch>
           <Route exact path="/" component={HomePage} /> 
           <Route exact path="/about" component={ABOUT} /> 
          <Route  path="/RFID" component={RFID}/>
          <Route  path="/Customised" component={Customised}/>
          <Route  path="/auth" component={Authority} /> 
        </Switch>
      </div>


    </BrowserRouter>
  );
}
export default App;
